// Listen for messages from popup and content script
chrome.runtime.onMessage.addListener((message, sender, sendResponse) => {
  if (message.type === 'GET_BLOCKED_DOMAINS') {
    const locationBannedDomains = bannedDomains[userLocation] || bannedDomains['default'];
    sendResponse({
      bannedDomains: locationBannedDomains,
      userBlockedDomains,
      overrideDomains,
      location: userLocation,
      fullBannedList: bannedDomains
    });
  } else if (message.type === 'UPDATE_USER_PREFERENCES') {
    userBlockedDomains = message.userBlockedDomains;
    overrideDomains = message.overrideDomains;
    chrome.storage.local.set({
      userBlockedDomains,
      overrideDomains
    });
    sendResponse({ success: true });
  } else if (message.type === 'UPDATE_BANNED_DOMAINS') {
    bannedDomains = message.bannedDomains;
    chrome.storage.local.set({
      bannedDomains
    });
    sendResponse({ success: true });
  }
});
